import React from 'react';
import { MenuItems } from './MenuItems';

const Navbar = () => {
    return (
        <>
            <nav className="navbarItems">
                <h1 className="navbar-logo">SellYourCar</h1>
                <div className="menu-icon">

                </div>
                <ul>
                    <li><a className={i.cName}></a></li>
                </ul>
            </nav>
        </>
    )
}

export default Navbar;
